import React, { useState } from "react";

const About = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [modalContent, setModalContent] = useState("");

  const openModal = (content) => {
    setModalContent(content);
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
    setModalContent("");
  };

  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "flex-start",
        padding: "140px",
        maxWidth: "1390px",
      }}
    >
      {/* Video Card */}
      <div
        style={{
          width: "100%",
          maxWidth: "550px",
          borderRadius: "10px",
          overflow: "hidden",
          marginBottom: "20px",
          marginTop: "-600px",
          boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
        }}
      >
        <video style={{ width: "100%", display: "block" }} autoPlay loop muted>
          <source src="/videos/aboutvideo.mp4" type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </div>

      {/* Content Section */}
      <div style={{ marginLeft: "80px", flex: 1 }}>
        <h2
          style={{
            fontSize: "50px",
            fontWeight: "bold",
            marginBottom: "10px",
            color: "orange",
            marginLeft: "170px",
            marginTop: "-50px",
          }}
        >
          About Us
        </h2>
        <p
          style={{
            fontSize: "18px",
            color: "#555",
            marginBottom: "30px",
            lineHeight: "1.4",
          }}
        >
          The<span style={{ color: "green" }}> All India Financial Borrowers Federation (AIFBF)</span> is a visionary platform dedicated to empowering financial borrowers across India.
        </p>
        <p
          style={{
            fontSize: "18px",
            color: "#555",
            lineHeight: "1.4",
          }}
        >
          With a forward-looking and proactive approach, we aim to foster a better financial ecosystem for a brighter future.
        </p>

        {/* Cards Section */}
        <div
          style={{
            display: "flex",
            justifyContent: "space-between",
            marginTop: "40px",
            gap: "20px",
          }}
        >
          {/* Card 1 */}
          <div
            style={{
              flex: "1",
              maxWidth: "1000px",
              backgroundColor: "#f9f9f9",
              borderRadius: "10px",
              padding: "20px",
              textAlign: "center",
              boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
              marginLeft: "30px",
            }}
          >
            <h3
              style={{
                color: "#F09319",
                fontSize: "22px",
                fontWeight: "bold",
                marginBottom: "8px",
              }}
            >
              10K+
            </h3>
            <p style={{ fontSize: "14px", color: "#555" }}>Borrowers Helped</p>
            <button
              onClick={() =>
                openModal(
                  "Facilitating Economic Growth:\n\nInvestment in Infrastructure: Build and improve physical infrastructure (e.g., roads, energy) to enhance productivity and economic activity."
                )
              }
              style={{
                marginTop: "10px",
                padding: "10px 20px",
                fontSize: "16px",
                backgroundColor: "#F09319",
                color: "#fff",
                border: "none",
                borderRadius: "5px",
                cursor: "pointer",
              }}
            >
              Learn More
            </button>
          </div>

          {/* Card 2 */}
          <div
            style={{
              flex: "1",
              maxWidth: "1000px",
              backgroundColor: "#f9f9f9",
              borderRadius: "10px",
              padding: "20px",
              textAlign: "center",
              boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
              marginRight: "30px",
            }}
          >
            <h3
              style={{
                color: "green",
                fontSize: "22px",
                fontWeight: "bold",
                marginBottom: "8px",
              }}
            >
              95%
            </h3>
            <p style={{ fontSize: "14px", color: "#555" }}>Success Rate</p>
            <button
              onClick={() =>
                openModal(
                  "Enhancing the Financial Ecosystem:\n\nAccess to Credit: Ensure individuals and businesses have fair access to credit for growth and development."
                )
              }
              style={{
                marginTop: "10px",
                padding: "10px 20px",
                fontSize: "16px",
                backgroundColor: "green",
                color: "#fff",
                border: "none",
                borderRadius: "5px",
                cursor: "pointer",
              }}
            >
              Learn More
            </button>
          </div>
        </div>
      </div>

      {/* Modal */}
      {isModalOpen && (
        <div
          style={{
            position: "fixed",
            top: 0,
            left: 0,
            width: "100%",
            height: "100%",
            backgroundColor: "rgba(0, 0, 0, 0.5)",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <div
            style={{
              width: "600px",
              backgroundColor: "#fff",
              borderRadius: "10px",
              padding: "20px",
              textAlign: "center",
              position: "relative",
            }}
          >
            <button
              onClick={closeModal}
              style={{
                position: "absolute",
                top: "10px",
                right: "10px",
                backgroundColor: "red",
                color: "#fff",
                border: "none",
                borderRadius: "50%",
                width: "30px",
                height: "30px",
                cursor: "pointer",
              }}
            >
              X
            </button>
            <img
              src="/images/modalImage.jpg"
              alt="Modal Visual"
              style={{
                width: "100%",
                height: "200px",
                objectFit: "cover",
                borderRadius: "10px",
                marginBottom: "20px",
              }}
            />
            <h3 style={{ fontSize: "24px", fontWeight: "bold", color: "#333" }}>
              Modal Heading
            </h3>
            <p style={{ fontSize: "16px", color: "#555", whiteSpace: "pre-wrap" }}>
              {modalContent}
            </p>
          </div>
        </div>
      )}
    </div>
  );
};

export default About;
